import{_ as t,o as s,c as p,e}from"./chunks/framework.mYMQfzZG.js";const o="/assets/DSC_0144.ihGf9W5S.jpg",a="/assets/DSC_0164.0lnrCPwb.jpg",r="/assets/IMG_3305.aM8fJF26.jpg",c="/assets/IMG_3311.-ZiblsLf.jpg",i="/assets/IMG_3292.zLzYVKkA.jpg",v=JSON.parse('{"title":"Дом моды","description":"Workplace в Сыктывкаре","frontmatter":{"title":"Дом моды","description":"Workplace в Сыктывкаре","date":"2016-11-10","icon":"logo.png","address":"ул. Орджоникидзе, 16","city":"г. Сыктывкар","place":"Напротив Пушкинской гимназии","url":"https://workplace.land","tel":"+7 (912) 197-78-48","hours":"с 10 до 22","vk":"workplace_komi","coord":[61.67353934301797,50.83390118505545],"status":"closed"},"headers":[],"relativePath":"workshop/archive/workplace-syktyvkar/index.md","filePath":"workshop/archive/workplace-syktyvkar/index.md"}'),_={name:"workshop/archive/workplace-syktyvkar/index.md"},n=e('<p>Воркплейс — это личный дом моды для дизайнеров одежды, конструкторов и портных. Именно здесь они работают над заказами своих клиентов, создают коллекции и проводят занятия по шитью.</p><p>Воркплейс оборудован всем необходимым оборудованием: здесь вы найдете бытовые и промышленные швейные машины, оверлоки, манекены, парогенератор. Рабочие места, зоны для проведения мастер-классов, большой раскройный стол и, конечно, комфортабельная примерочная созданы специально для всех тех, кто занимается шитьем.</p><p>Дизайнеры Дома моды создают новые модели, встречаются с клиентами и общаются с коллегами. В воркплейсе есть статичные и раздвижные манекены разных размеров — найти нужные формы будет в разы проще, чем дома.</p><p><img src="'+o+'" alt=""></p><p><img src="'+a+'" alt=""></p><p>Просторное и очень светлое пространство для вдохновения и творчества, невероятные проекты и яркие снимки! Рабочие зоны закрепляются за резидентами.</p><p><img src="'+r+'" alt=""></p><p>В доме моды есть промышленный оверлок и прямострочная машина, которыми может пользоваться каждый резидент. У этого оборудования более 3000 оборотов в минуту, — такая мощь способна дать невероятное качество вашим моделям.</p><p><img src="'+c+'" alt=""></p><p>Встречи с клиентами проходят в уютных примерочных.</p><p><img src="'+i+'" alt=""></p><p>Теперь вам, дорогие портные, нет нужды работать дома! В распоряжении резидентов воркплейса все пространство, где есть швейные машины, оверлоки, парогенератор, манекены, удобные рабочие места, раскройный стол, уборка, чай, кофе и wi-fi. А главное — уютная примерочная-шоурум для общения с клиентами.</p><h3 id="как-стать-резидентом" tabindex="-1">Как стать резидентом <a class="header-anchor" href="#как-стать-резидентом" aria-label="Permalink to &quot;Как стать резидентом&quot;">​</a></h3><p>Воркплейс подойдет тем мастерам, кто решил работать на себя не дома, а в специально оборудованном для этого пространстве. Сюда можно перевезти свои вещи и оборудование, используя при этом, ресурсы всего пространства. Будущий резидент воркплейса заключает договор по паспорту и ежемесячно пополняет свой баланс:</p><p><strong>8900 р. / месяц — постоянный абонемент</strong> Вы можете находиться в воркплейсе с утра до вечера, принимать неограниченное количество клиентов в примерочных, привезти свое промышленное оборудование и хранить много материалов и вещей за своим закрепленным местом. Абонемент рассчитан на работу одного человека.</p><p><strong>80 р. / час — работа в воркплейсе по часам</strong> Этот абонемент удобен, если вы не готовы перевезти свое рабочее место в воркплейс прямо сейчас. Для работы вы пополняете свой баланс минимум на 1000 руб., из которых будут списываться суммы за время, проведенное в «Доме моды». Вы можете использовать раскройный стол, швейное оборудование, парогенератор и, конечно, примерочные для встреч с клиентами.</p><p><strong>А также для резидентов:</strong> Просторная индустриальная примерочная, большой раскройный стол, любое свободное швейное оборудование (как бытовые, так и промышленные машины), профессиональная гладильная система, доступ к интернету, возможность индивидуального оформления своего рабочего места, уборка рабочего места, чай и печенье.</p>',17),l=[n];function d(k,m,h,g,f,u){return s(),p("div",null,l)}const x=t(_,[["render",d]]);export{v as __pageData,x as default};
